import "./Expense.css";
import ExpenseItem from "./ExpenseItem";

function Expense(props) {
  return (
    <div className="expenses">
      {props.data.map((item) => (
        <div key="id">
          <ExpenseItem
            title={item.title}
            date={item.date}
            amount={item.amount}
          ></ExpenseItem>
        </div>
      ))}
    </div>
  );
}

export default Expense;

